import React from 'react';
import '../Stylings/Calendar.css';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import {getYear, getMonth} from '../Calendar/DateFunctions.js';

export function Calendar() {
    var year = getYear();
    var month = getMonth();

    populateDaysDisplay();

    return (
        <div className="calendarContainer">
            <div className="calendarHeader">
                <h1>{month} {year}</h1>
                <button className="arrowBack"> <ArrowBackIosNewIcon /> </button>
                <button className="arrowForward"> <ArrowForwardIosIcon /> </button>
            </div>

            <div className="daysDisplay">
                <div className="weekDayDiv" id="monDiv">
                    <h5>Mon</h5>
                    {/* <p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p> */}
                </div>
                <div className="weekDayDiv" id="tueDiv">
                    <h5>Tue</h5>
                    {/* <p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p> */}
                </div>
                <div className="weekDayDiv" id="wedDiv">
                    <h5>Wed</h5>
                    {/* <p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p> */}
                </div>
                <div className="weekDayDiv" id="thuDiv">
                    <h5>Thu</h5>
                    {/* <p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p> */}
                </div>
                <div className="weekDayDiv" id="friDiv">
                    <h5>Fri</h5>
                    {/* <p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p> */}
                </div>
                <div className="weekDayDiv" id="satDiv">
                    <h5>Sat</h5>
                    {/* <p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p> */}
                </div>
                <div className="weekDayDiv" id="sunDiv">
                    <h5>Sun</h5>
                    {/* <p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p><p>15</p> */}
                </div>
            </div>
        </div>
    );
}
